import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsxRuntime classic */
/* @jsx mdx */
import { Playground } from 'docz'
import Slider from './index'


const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "slider轮播图组件"
    }}>{`Slider轮播图组件`}</h1>
    <h4 {...{
      "id": "默认"
    }}>{`默认`}</h4>
    <Playground __position={0} __code={'<Slider\n  bannerList={[\n    {\n      imgUrl:\n        \'http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg\',\n      url: \'https://www.dragonpass.com.cn/\',\n    },\n    {\n      imgUrl:\n        \'https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg\',\n      url:\n        \'https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad\',\n    },\n  ]}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Slider
    }} __codesandbox={`undefined`} mdxType="Playground">
    <Slider bannerList={[{
        imgUrl: "http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg",
        url: "https://www.dragonpass.com.cn/"
      }, {
        imgUrl: "https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg",
        url: "https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad"
      }]} mdxType="Slider" />
    </Playground>
    <h4 {...{
      "id": "自定义参数名称"
    }}>{`自定义参数名称`}</h4>
    <Playground __position={1} __code={'<Slider\n  bannerList={[\n    {\n      aa:\n        \'http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg\',\n      bb: \'https://www.dragonpass.com.cn/\',\n    },\n    {\n      aa:\n        \'https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg\',\n      bb:\n        \'https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad\',\n    },\n  ]}\n  fieldNames={{ imgUrl: \'aa\', url: \'bb\' }}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Slider
    }} __codesandbox={`undefined`} mdxType="Playground">
    <Slider bannerList={[{
        aa: "http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg",
        bb: "https://www.dragonpass.com.cn/"
      }, {
        aa: "https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg",
        bb: "https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad"
      }]} fieldNames={{
        imgUrl: 'aa',
        url: 'bb'
      }} mdxType="Slider" />
    </Playground>
    <h4 {...{
      "id": "右下角显示分页数量"
    }}>{`右下角显示分页数量`}</h4>
    <Playground __position={2} __code={'<Slider\n  bannerList={[\n    {\n      imgUrl:\n        \'http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg\',\n      url: \'https://www.dragonpass.com.cn/\',\n    },\n    {\n      imgUrl:\n        \'https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg\',\n      url:\n        \'https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad\',\n    },\n  ]}\n  isShowPageNumber={true}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Slider
    }} __codesandbox={`undefined`} mdxType="Playground">
    <Slider bannerList={[{
        imgUrl: "http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg",
        url: "https://www.dragonpass.com.cn/"
      }, {
        imgUrl: "https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg",
        url: "https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad"
      }]} isShowPageNumber={true} mdxType="Slider" />
    </Playground>
    <h4 {...{
      "id": "图片圆角设置"
    }}>{`图片圆角设置`}</h4>
    <Playground __position={3} __code={'<Slider\n  bannerList={[\n    {\n      imgUrl:\n        \'http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg\',\n      url: \'https://www.dragonpass.com.cn/\',\n    },\n    {\n      imgUrl:\n        \'https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg\',\n      url:\n        \'https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad\',\n    },\n  ]}\n  borderRadius=\"20px\"\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Slider
    }} __codesandbox={`undefined`} mdxType="Playground">
    <Slider bannerList={[{
        imgUrl: "http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg",
        url: "https://www.dragonpass.com.cn/"
      }, {
        imgUrl: "https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg",
        url: "https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad"
      }]} borderRadius="20px" mdxType="Slider" />
    </Playground>
    <h4 {...{
      "id": "点击获取数据"
    }}>{`点击获取数据`}</h4>
    <Playground __position={4} __code={'<Slider\n  bannerList={[\n    {\n      imgUrl:\n        \'http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg\',\n      url: \'https://www.dragonpass.com.cn/\',\n    },\n    {\n      imgUrl:\n        \'https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg\',\n      url:\n        \'https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad\',\n    },\n  ]}\n  onClick={item => alert(JSON.stringify(item))}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Slider
    }} __codesandbox={`undefined`} mdxType="Playground">
    <Slider bannerList={[{
        imgUrl: "http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg",
        url: "https://www.dragonpass.com.cn/"
      }, {
        imgUrl: "https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg",
        url: "https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad"
      }]} onClick={item => alert(JSON.stringify(item))} mdxType="Slider" />
    </Playground>
    <h2 {...{
      "id": "用法"
    }}>{`用法`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-js"
      }}>{`import { Slider } from 'dp-react-mobile'

// 导入
<Slider 
  bannerList={[
    {imgUrl: "http://img.dragonpass.com.cn/uploadFile/url/20190708/c57400f8-f929-4cae-99fb-9fe10e7cad20.jpg", url: "https://www.dragonpass.com.cn/"},
    {imgUrl: "https://image.dragonpass.com.cn/uploadFile/images/news/banner/longtka.jpg", url: "https://www.dragonpass.com.cn/order/dragoncard/buycardlist?channel=ad"}
  ]}
/>
`}</code></pre>
    <h2 {...{
      "id": "api文档"
    }}>{`API文档`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`参数`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`说明`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`默认值`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`bannerList`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`[{ imgUrl: string, url: string }]`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`必传-轮播列表数据`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`[]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`isLoop`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`boolean`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`非必传-是否循环轮播图`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`true`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`isAuto`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`boolean`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`非必传-是否自动轮播`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`false`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`isShowPagination`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`boolean`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`非必传-是否显示分页器`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`true`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`isShowPageNumber`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`boolean`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`非必传-是否右下角显示分页数量`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`false`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`fieldNames`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`{{ imgUrl: string, url: string }}`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`非必传-自定义参数名称`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`{}`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`height`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`非必传-设置高度`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`'auto'`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`borderRadius`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`非必传-设置圆角`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`'none'`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`spaceBetween`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`number`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`非必传-设置轮播图间距`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`0`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`onClick`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(item) => {}`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`非必传-自定义点击跳转`}</td>
          <td parentName="tr" {...{
            "align": null
          }}></td>
        </tr>
      </tbody>
    </table>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
